// Home.js

import React, {Component} from 'react';

import '../assets/customStyles.css';

class Home extends Component {
    render() {
        return (
            <div style={{
                flex: 1, minHeight: '100%', backgroundPosition: 'center',
                backgroundSize: 'cover',
            }}>


                <body>
                <header class="header">
                    <div class="w-container">
                        <div class="logo-wrapper w-clearfix">
                            <img
                                src="https://uploads-ssl.webflow.com/5d9ceab8ccdd266e2c43882b/5d9ceab9ccdd263edf43883b_logo-white.png"
                                width="56" alt="" class="logo-icon"/>
                            <h1 class="logo-text">Gate Of Egypt</h1>
                        </div>
                        <h1>Find Places.</h1>
                        <p class="main-subtitle">
                            Gate of Egypt is a mobile app that helps you to find places well sorted
                            under category, sub-category in adiition to location
                        </p>

                        <a href="#" class="app-button w-inline-block">
                            <img
                            src="https://uploads-ssl.webflow.com/5d9ceab8ccdd266e2c43882b/5d9ceab9ccdd267e92438840_app-store-apple.png"
                            width="141" alt=""/>
                        </a>


                        <a href="#" class="app-button w-inline-block">
                        <img src="https://uploads-ssl.webflow.com/5d9ceab8ccdd266e2c43882b/5d9ceab9ccdd26d2fe43883a_app-store-google.png" width="141" alt=""/>
                        </a>

                    </div>
                </header>

                </body>


            </div>
        );
    }
}

export default Home;
